    function(layer){

    let handleObject = feature=>typeof(feature)=='object' ? JSON.stringify(feature) : feature;
    let fields = ["line_name", "type_tr", "stat_name"];
    let aliases = ["line_name", "type_tr", "stat_name"];
    let table = '<table>' +
        String(

            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>

    return div
    }
